import React from 'react';
import { 
  Sparkles, 
  Zap, 
  Shield, 
  Cpu, 
  Globe, 
  Lock, 
  Cloud, 
  Code 
} from 'lucide-react';

const FloatingElements = () => {
  const elements = [
    { icon: <Sparkles className="w-6 h-6" />, color: 'from-yellow-400 to-pink-500', delay: 0 },
    { icon: <Zap className="w-6 h-6" />, color: 'from-blue-400 to-cyan-500', delay: 0.5 },
    { icon: <Shield className="w-6 h-6" />, color: 'from-green-400 to-emerald-500', delay: 1 },
    { icon: <Cpu className="w-6 h-6" />, color: 'from-purple-400 to-violet-500', delay: 1.5 },
    { icon: <Globe className="w-6 h-6" />, color: 'from-indigo-400 to-blue-500', delay: 2 },
    { icon: <Lock className="w-6 h-6" />, color: 'from-red-400 to-orange-500', delay: 2.5 },
    { icon: <Cloud className="w-6 h-6" />, color: 'from-sky-400 to-blue-500', delay: 3 },
    { icon: <Code className="w-6 h-6" />, color: 'from-pink-400 to-rose-500', delay: 3.5 },
  ];

  return (
    <div className="fixed inset-0 pointer-events-none z-0 overflow-hidden">
      {elements.map((element, index) => (
        <div
          key={index}
          className={`absolute rounded-2xl glass-effect p-4
                     bg-gradient-to-br ${element.color}
                     animate-float${index % 3 === 0 ? '-slow' : index % 3 === 1 ? '' : '-slower'}
                     flex items-center justify-center`}
          style={{
            top: `${15 + Math.random() * 70}%`,
            left: `${5 + Math.random() * 90}%`,
            width: `${60 + Math.random() * 80}px`,
            height: `${60 + Math.random() * 80}px`,
            animationDelay: `${element.delay}s`,
            opacity: 0.1 + Math.random() * 0.2,
          }}
        >
          <div className="text-white">
            {element.icon}
          </div>
          <div className="absolute inset-0 rounded-2xl border border-white/20"></div>
        </div>
      ))}
    </div>
  );
};

export default FloatingElements;
